import React from 'react'
import './Navbar.css'
export const Navbar=()=>{
    return(
        <nav className="nav">
            <center>
            <img src='pokeball.png' alt='' style={{width:'30px',height:'30px',transform:'translateY(10px) translateX(20px)'}}/>
            <h1 style={{textAlign:'center'}}>Pokedex</h1>
            <img src='pokeball.png' alt=''style={{width:'30px',height:'30px',transform:'translateY(10px) translateX(-20px)'}}/>
            </center>
       </nav>
    )
}//
